import React from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div
      className="container mt-5 text-center"
      style={{ minHeight: "100vh", background: "linear-gradient(135deg, #e9ecef, #dee2e6)" }}
    >
      <h2 className="mb-4">Dashboard</h2>
      <div className="d-flex justify-content-around mb-5">
        <button className="btn btn-primary btn-lg" onClick={() => navigate("/students")}>
          Students
        </button>
        <button className="btn btn-success btn-lg" onClick={() => navigate("/marks")}>
          Marks
        </button>
        <button className="btn btn-warning btn-lg" onClick={() => navigate("/admissions")}>
          Admissions
        </button>
      </div>
      <button className="btn btn-danger" onClick={handleLogout}>
        Logout
      </button>
    </div>
  );
};

export default Dashboard;
